import React from "react";
import  { colors } from "../../styling/colors";
import SpringBar from "./SpringBar";
import { FaLinkedin, FaInstagram } from "react-icons/fa";
import { AiOutlineMail, AiFillGithub } from "react-icons/ai";
import { Trail, config } from "react-spring";

const springDone = false;

// Create array for trail animation
const bars = [];
for (let i = 0; i < 10; i++) {
    bars.push(
        <SpringBar barWidth="10vw" barColor={colors.white} key={i}> </SpringBar>
    );
}

// Function that is actually exported to be rendered:
function Welcome({

}) {
    return (
        <div
          className="full_section"
          style={{ backgroundColor: colors.white, position: "absolute" }}
        >
            <div className="section_main_content">
                <h1> Hi This Is Landing Component </h1>
            </div>

            if (springDone) {
                <div 
                  className="full_Section"
                  style={{ backgroundColor: colors.blue }}
                >
                </div>

            } else {
                <Trail
                  items={bars}
                  keys={(item) => item.key }
                  config={config.slow}
                  onRest={() => springDone=true}
                >
                    { props => (<div>{item}</div>)}
                </Trail>
            }
        </div>
    )
}

export default Welcome
